import React, { useEffect, useState } from "react";
import axios from "axios";

interface User {
    id?: number;
    address: string;
    email: string;
    username: string;
    password: string;
}

function App() {
    const [userId, setUserId] = useState("");
    const [purchases, setPurchases] = useState([]);
    const [users, setUsers] = useState<User[]>([]);
    const [newUser, setNewUser] = useState<User>({
        username: "",
        email: "",
        address: "",
        password: ""
    });
    const [editUserId, setEditUserId] = useState<number | null>(null);

    const loadUsers = async () => {
        const res = await axios.get("/api/users");
        setUsers(res.data);
    };

    useEffect(() => {
        loadUsers();
    }, []);

    const handleCreateUser = async () => {
        try {
            await axios.post("/api/users", newUser);
            setNewUser({ username: "", email: "", address: "", password: "" });
            loadUsers();
        } catch {
            alert("Error creating user");
        }
    };

    const handleUpdateUser = async () => {
        if (editUserId === null) return;
        try {
            await axios.put(`/api/users/${editUserId}`, newUser);
            setEditUserId(null);
            setNewUser({ username: "", email: "", address: "", password: "" });
            loadUsers();
        } catch {
            alert("Error updating user");
        }
    };

    const handleEdit = (user: User) => {
        setEditUserId(user.id!);
        setNewUser(user);
    };

    const handleDeleteUser = async (id?: number) => {
        try {
            await axios.delete(`/api/users/${id}`);
            loadUsers();
        } catch {
            alert("Error deleting user");
        }
    };

    const handleBuy = async () => {
        try {
            const response = await axios.post(`/api/purchases/buy?userId=${userId}`);
            alert("Purchase created with ID: " + response.data.id);
        } catch (error) {
            alert("Error creating purchase");
        }
    };

    const handleGetPurchases = async () => {
        try {
            const response = await axios.get(`/api/purchases/user/${userId}`);
            setPurchases(response.data);
        } catch (error) {
            alert("Error fetching purchases");
        }
    };

    return (
        <div style={{ padding: "20px" }}>
            <h1>Purchases App</h1>

            <h2>{editUserId ? "Edit User" : "Create User"}</h2>
            <input
                type="text"
                placeholder="Username"
                value={newUser.username}
                onChange={(e) => setNewUser({ ...newUser, username: e.target.value })}
            />
            <input
                type="email"
                placeholder="Email"
                value={newUser.email}
                onChange={(e) => setNewUser({ ...newUser, email: e.target.value })}
            />
            <input
                type="text"
                placeholder="Address"
                value={newUser.address}
                onChange={(e) => setNewUser({ ...newUser, address: e.target.value })}
            />
            <input
                type="password"
                placeholder="Password"
                value={newUser.password}
                onChange={(e) => setNewUser({ ...newUser, password: e.target.value })}
            />
            {editUserId ? (
                <button onClick={handleUpdateUser}>Update User</button>
            ) : (
                <button onClick={handleCreateUser}>Create User</button>
            )}

            <h2>All Users</h2>
            <ul>
                {users.map((u) => (
                    <li key={u.id}>
                        {u.username} ({u.email}){" "}
                        <button onClick={() => setUserId(u.id?.toString() || "")}>Use</button>{" "}
                        <button onClick={() => handleEdit(u)}>Edit</button>{" "}
                        <button onClick={() => handleDeleteUser(u.id)}>Delete</button>
                    </li>
                ))}
            </ul>

            <h2>Selected User ID: {userId || "(None Selected)"}</h2>
            <button onClick={handleBuy}>Buy Now</button>
            <button onClick={handleGetPurchases} style={{ marginLeft: "10px" }}>
                View Purchases
            </button>

            <h2>Purchases</h2>
            <ul>
                {purchases.map((p: any) => (
                    <li key={p.id}>
                        {p.product?.name} - Qty: {p.quantity} - Total: {p.totalAmount}
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default App;
